const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are {props.age} years old!</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name='Ruusari' age={1} />
      <Hello name='Ronkeli' age={4}/>
      <Hello name='Sirkkeli' age={5}/>
    </div>
  )
}

export default App;
